import React, {Component} from 'react';
import {Menu, Button} from 'semantic-ui-react';



class Nav extends Component{



    render(){


        return(
            <Menu color='blue'>
                <Menu.Item>
                    <Button color='blue'> Back </Button>
                </Menu.Item>


                <Menu.Item position="right"> Sign out</Menu.Item>
            </Menu>

        );
    }
}

export default Nav;
